function triggerPartialView(componentID) {
    var dllComponentGlobalVariables = DLLCollection[componentID];
    var DLLComponentID = "DynamicListContents_" + componentID;

    if (!dllComponentGlobalVariables.showPartialCard) {
        return;
    }

    if ($("#" + DLLComponentID + " .gridLayout-class .carousel-inner").hasClass("grid-view-nopartial") ||
        $("#" + DLLComponentID + " .thumbnailLayout-class .carousel-inner").hasClass("grid-view-nopartial") ||
        $("#" + DLLComponentID + " .tombstoneLayout-class .carousel-inner").hasClass("grid-view-nopartial")) {

        $("#" + DLLComponentID + " .gridLayout-class .carousel-inner").removeClass("grid-view-nopartial");
        $("#" + DLLComponentID + " .thumbnailLayout-class .carousel-inner").removeClass("grid-view-nopartial");
        $("#" + DLLComponentID + " .tombstoneLayout-class .carousel-inner").removeClass("grid-view-nopartial");
        if ($(window).width() <= 456) {
            $("#" + DLLComponentID + " .carousel .carousel-item").each(function () {
                var next = $(this).next();
                if (!next.length) {
                    next = $(this).siblings(":first");
                }
                next.children(":first-child").clone().appendTo($(this));
            }).each(function () {
                var prev = $(this).prev();
                if (!prev.length) {
                    prev = $(this).siblings(":last");
                }
                prev.children(":nth-last-child(2)").clone().prependTo($(this));
            });
        }
    }
}

