"use strict";

var _buttonList, listItem, _navPageValURL, navPageNewTab, primaryNavData;
var datasource, elementId;
var strIDValue;

$(".global-navigation").map(function (index, element) {
    if ($(".global-navigation").length > 0) {
        datasource = JSON.parse($(element).attr("data-src"));
        elementId = $(element).attr("id");
        addHNavigation(datasource, elementId, index);
    } else {
        datasource = null;
        elementId = null;
    }
});

function addHNavigation(datasource, elementId, indexid) {
    $.each(datasource, function (primaryNavkey, primaryNav) {
        $.each(primaryNav, function (navPageKey, navPageVal) {

            //Condition for checking isclickable
            var targetURL = navPageVal.url;
            strIDValue = "";
            if (navPageVal.urlParams > "")
                targetURL += "?" + navPageVal.urlParams;
            _navPageValURL = (navPageVal.hasDropDownMenu === "false" ? targetURL : "#");

            //Condition for opening anchor link in a new tab
            navPageNewTab = ((navPageVal.newTab === "yes") ? "_blank" : "_self");
            if (navPageVal.hide_primary_nav === "false") {
                //start: Template for creating button List
                if (navPageVal.linkType !== "cta") {
                    listItem = $("<li/>", {
                        id: "listitemId" + primaryNavkey + indexid
                    });

                    if (navPageVal.hasOwnProperty("child") === true && navPageVal.hasDropDownMenu === 'true') {
                        strIDValue = navPageVal.title;
                        strIDValue = strIDValue.replace(/\s+/g, '');
                        listItem.append($("<a />", {
                            id: strIDValue,
                            "aria-expanded": "false",
                            "role": "button",
                            href: _navPageValURL,
                            text: navPageVal.title,
                            target: navPageNewTab,
                            "class": "nav-dropdown-link"
                        }));

                        listItem.append(createGlovalNavChild(navPageVal.child));
                        listItem.find('ul').wrap($("<div />", {
                            "role": "navigation",
                            "class": "nav-dropdown",
                            "aria-labelledby": strIDValue
                        }))
                    } else {
                        listItem.append($("<a />", {
                            href: _navPageValURL,
                            text: navPageVal.title,
                            target: navPageNewTab,
                            "class": "nav-static-link"
                        }));
                    }
                    //end: Template for creating button List
                } else {
                    //start: Template to create list item
                    listItem = $("<li/>", {
                        id: "listButtonID" + primaryNavkey + indexid
                    });
                    listItem.append($("<a />", {
                        "role": "button",
                        href: _navPageValURL,
                        text: navPageVal.title,
                        "class": "nav-specialty-item",
                        target: navPageNewTab
                    }));
                    //end: Template to create list item
                }
            }
            $("#" + elementId).find('ul.nav-menu').append(listItem);
        });
    });
}

// Creating DropDown Dom
function createGlovalNavChild(childArray) {
    ULWrapper = $("<ul />");

    $.each(childArray, function (navParentLinkKey, navParentLinkVal) {
        $.each(navParentLinkVal, function (navParentArrayLinkKey, navParentArrayLinkVal) {
            if (navParentArrayLinkVal.hide_primary_nav === "false") {
                //start: Template for dropdown List
                dropdownList = $("<li/>")
                    .append($("<a />", {
                        href: navParentArrayLinkVal.url,
                        text: navParentArrayLinkVal.title
                    }));
                //end: Template for dropdown List
                $(ULWrapper).append(dropdownList);
            }
        });
    });
    return ULWrapper;
}

