window.TruistLocationsMap.mapquest = function () {
  var options, qmap, markerGroup, markerBounds;
  var markers = [];
  var _private = {
    init: function init(opts) {
      options = opts;
      markerGroup = L.layerGroup();
      setTimeout(function () {
        $('.map-view .leaflet-control-container .leaflet-top .leaflet-control a').removeAttr('title');
         }, 100);
      $(window).on('resize', function () {
          var win = $(this); //this = window

              if (win.width() >= 1024) { 
              $('.map-view').show();
              }
      });
    },
    renderMap: function renderMap() {
      if (!qmap && options.element instanceof Element && getComputedStyle(options.element).display != 'none') {
        qmap = L.mapquest.map(options.element, {
          center: options.center,
          zoom: options.zoom,
          layers: [L.mapquest.tileLayer('map'), // 'map' here being designator for type of map to generate, not an element id
          markerGroup]
        });
      }

      return qmap;
    },
    createMarker: function createMarker(coords, label, $item, $alt) {
      var marker = L.marker(coords, {
        title: label,
        alt: $alt,
        icon: L.icon({
          iconUrl: options.marker_icon_path
        })
      }); //console.log( marker );
     // marker.bindPopup($alt);	

      markers.push(marker); // TODO: add event handlers for click, mouseover, mouseout
    },
    showMarkers: function showMarkers(start, end) {
      if (!_private.renderMap()) return;
      markerBounds || (markerBounds = L.latLngBounds());
      markers.slice(start, end).forEach(function (marker) {
        if (!marker || markerGroup.hasLayer(marker)) return;
        markerGroup.addLayer(marker);
        markerBounds.extend(marker.getLatLng());
      });
      qmap.fitBounds(markerBounds, {
        maxZoom: options.zoom
      });
    },
    hideMarkers: function hideMarkers(start, end) {
      markers.slice(start, end).forEach(function (marker) {
        return markerGroup.removeLayer(marker);
      });

      _private.rebound();
    },
    deleteMarkers: function deleteMarkers(start, end) {
      start = start || 0;
      var count = (end || markers.length) - start;
      markers.splice(start, count).forEach(function (marker) {
        return markerGroup.removeLayer(marker);
      });

      _private.rebound();
    },
    rebound: function rebound() {
      markerBounds = L.latLngBounds();
      markerBounds.extend(markerGroup.getLayers().map(function (marker) {
        return marker.getLatLng();
      }));
    },
    getMap: function getMap() {
      return _private.renderMap();
    }
  };
  var _public = {
    init: _private.init,
    createMarker: _private.createMarker,
    showMarkers: _private.showMarkers,
    hideMarkers: _private.hideMarkers,
    deleteMarkers: _private.deleteMarkers,
    getMap: _private.getMap
  };
  return _public;
}();
