window.TruistLocations = function () {
  // TODO: reassess scoping of everything declared outside of _private and _public
  var positionPromise, advisorLocationsPromise;
  var $component, modeMaster;
  var $profileContent, $prefDirectionsLink, $seeAllLinkage;
  var $resultPagesWrapper, $resultPages, $delta;
  var $mapView, $listViewToggle;
  var queryParams = new URLSearchParams( window.location.search );

  //---------------------------------------
  var _private = {
    COMPONENT_SELECTOR: '.js-truist-locations',
    COMPONENT_TITLE_SELECTOR: '.locator-header-title',
    PAGE_LENGTH: 3,

    //---------------------------------------
    preInit: function preInit() {
      if (!window.TruistLocationsResourcePath) return; // no need to go any further without this...
      console.log('*** LOCATIONS PRE-INIT ***');

      // Ensure fallback array is actually an array:
      window.TruistLocationsPreferredAddress &&
        ( typeof window.TruistLocationsPreferredAddress === 'object' ) &&
        ( window.TruistLocationsPreferredAddress.constructor === Array ) ||
        ( window.TruistLocationsPreferredAddress = [] );

      // Client position lookup:
      try {
        var gotCoords = false;
        var ref = new URL( document.referrer );
        if ( ref.origin != location.origin ) throw 'prior page not from Truist';

        var pos = JSON.parse( sessionStorage.getItem( TruistLocationsUtils.STORAGE_KEYNAME ), ( key, val ) => {
          if ( key == 'latlng' ) {
            gotCoords = true;
            return new truistLatLng( val );
          }
          else {
            return val;
          }
        } );

        if ( !gotCoords ) throw 'no valid coordinates relayed; obtain from client';

        positionPromise = new Promise( resolve => resolve( pos ) );
      }
      catch ( err ) {
        console.warn( err );
        positionPromise = CommonUtils.getPosition();
      }

      // Advisor locations lookup:
      advisorLocationsPromise = positionPromise.then( _private.getLocations ).catch( err => _private.getLocations() );
    },

    //---------------------------------------
    init: function init() {
      console.time( 'top address load' );
      $component = $( _private.COMPONENT_SELECTOR );
      $component.find( 'a[data-href]' ).attr( 'href', ( i, elem ) => $( elem ).data('href') );

      // View modes:
      modeMaster = new ModeMaster('advisor-locations', _private.COMPONENT_SELECTOR, {
        results: {
          in: TruistLocationsMap.showMarkers,
          out: TruistLocationsMap.hideMarkers
        },
        noresults: {
          in: _private.noResultsModeIn
        },
        waiting: {}
      });

      // Mappage!  Mappage is what bwings us togevver today!
      $mapView = $component.find('.map-view');

      TruistLocationsMap.init({
        element: $mapView.get(0)
      });

      // Event handling:
      $profileContent = $('.profile-content');
      $prefDirectionsLink = $profileContent.find( '.get-direction-link' );
      $seeAllLinkage = $profileContent.find( 'a.see-all-location-link' );

      $resultPagesWrapper = $component.find('.result-list-item-view') // see the lovely delegated event handlers!
        .on('marker', '.card', _private.handleMarker) // (including this custom event!)
        .on('click', '.map-view-toggle', _private.handleMapViewToggle);

      $listViewToggle = $component.find('.list-view-toggle').click(_private.handleListViewToggle);
      $delta = $resultPagesWrapper.find('a[data-delta]').click(_private.handleMoreLess);

      // Location rendering:
      _private.updateLocations();

      // Temp workaround:
      window.location.hash && CommonUtils.rollTo( window.location.hash, -60 );
    },

    //---------------------------------------
    getLocations: function () {
      var url, jqxhr;

      function getLocations( pos = {} ) {
        var latlng = pos.latlng;
        url || (url = new URL(queryParams.get('altrp') || "".concat(TruistLocationsResourcePath, ".json"), location));

        if (latlng) {
          url.searchParams.set('lat', latlng.lat);
          url.searchParams.set('long', latlng.lng);
        } else {
          url.searchParams.delete('lat');
          url.searchParams.delete('long');
        }

        url.searchParams.set('cb', Math.random());
        console.log('href:', url.href);
        jqxhr && jqxhr.abort();

        jqxhr = $.get({
          url: url.href,
          dataType: 'json'
        });

        return new Promise( ( resolve, reject ) =>
          jqxhr.always( ( data, status ) => {
            if ( status === 'abort' ) return; // no further action needed in this case; just means we cancelled one call to start another

            var locations = ( data.locationDetails || [] );
            locations.length || ( locations = ( Array.from( window.TruistLocationsPreferredAddress ) || [] ) );
            locations.saddr = encodeURIComponent( pos.text?.replace( /(\d{5})-\d{4}/, '$1' ) || latlng?.toString() || '' );
            locations.length ? resolve( locations ) : reject( data );
          } )
        );
      }

      return getLocations;
    }(),

    updateLocations: function () {
      var timeoutId;

      function updateLocations() {
        //console.trace();
        clearTimeout(timeoutId);
        timeoutId = setTimeout(function () {
          return modeMaster.addMode('waiting');
        }, 1000);
        advisorLocationsPromise.then(_private.locationResultHandler.buildResultList).catch(function (err) {
          console.trace('Error while retrieving or processing locations...', err);
          modeMaster.setMode('noresults');
        }).then(complete, complete); // ...because Edge 17 doesn't support .finally()
      }

      function complete() {
        clearTimeout(timeoutId);
        modeMaster.removeMode('waiting');
      }

      return updateLocations;
    }(),

    //---------------------------------------
    locationResultHandler: function () {
      const PROTOCOL = ( /\b(Mac|iPhone)\s+OS\b/i.test( navigator.userAgent ) ? 'maps:' : 'https:' );

      var $profileContentDetails;
      var firstLoad = true;
      var schedTemplate;

      function updateProfileCard(content, i) {
        $profileContentDetails || ( $profileContentDetails =
          $profileContent.find( '.detail-group-list >.detail-group-row.detail-color-apply' )
        );

        $profileContentDetails.find( 'span.js-miles' ).text( content.miles ? `(${content.miles} miles)` : '' );
        $profileContentDetails.find( '.js-streetaddress' ).text( ( i, was ) => TextFormatUtils.format( was, 'streetAddress' ) );

        try {
          const SPEEDBUMP_URL = new URL( $prefDirectionsLink.data( 'link' ), window.location.origin );
          SPEEDBUMP_URL.search = window.location.search;
          SPEEDBUMP_URL.searchParams.set( 'url', content.directionsHref );
          $prefDirectionsLink.attr( 'href', SPEEDBUMP_URL.href );
        }
        catch ( err ) {
          console.error( 'Could not set "Get Directions" href:', err );
        }
      }

      function buildResultList( locations = [] ) {
        locations?.sort( ( a, b ) => ( a.miles - b.miles ) );
        locations.length == 1 && ( locations[0].preferred = 'Y' ); // just in case

        var locationPages = [];

        while (locations.length) {
          locationPages.push(locations.splice(0, _private.PAGE_LENGTH));
        }

        console.log(locationPages);
        TruistLocationsMap.deleteMarkers();
        $resultPages && $resultPages.remove();

        $resultPages = $( locationPages.map( ( pg, pgi ) =>
          $( '#cloners >.js-result-page' ).clone().append( pg.map( ( loc, i ) =>
            renderLocation( loc, pgi * _private.PAGE_LENGTH + i, locations.saddr ).get(0)
          ) ).get(0)
        ) );

        $delta.first().parent().before( $resultPages ); // insert this way, rather than .prepend() into container, because .prepend() creates detached copies of the inserted elements, which accumulate whenever this method runs, thus a memory leak
        TextFormatUtils.normalizeLinks($resultPages.add($profileContent));
        $('a[href="tel:"], a[href="fax:"]').prev().addBack().remove(); // remove unused tel/fax links, along with their preceding icons
        _private.activatePages(1);

        if (firstLoad) {
          modeMaster.setMode('results');
          firstLoad = false;
        }
      }

      function renderLocation( loc, index, saddr ) {
        // Step 0: Scrub and format location data:
        var parts = loc.latLong.replace( /[^\d\-\.]+/g, ' ' ).trim().split( /\s+/ ).map( parseFloat );
        var coords = new truistLatLng( parts[1], parts[0] );
        var locationContent = prepLocationContent( loc, saddr );

        // Step 1: Iff preferred location, update profile card (top of page) accordingly:
        /^true|y(es)?$/i.test( loc.preferred ) && updateProfileCard( locationContent, index );

        // Step 2: Generate result card and corresponding map marker:
        var cardContent = [
          locationContent.addrParts.shift(),                                        //0
          locationContent.addrParts.join('\n'),                                     //1
          locationContent.miles ? "".concat(locationContent.miles, " Miles") : '',  //2
          loc.phone,                                                                //3
          loc.fax,                                                                  //4

          loc.hideHours ? ' ' : TruistLocationsUtils.getFormattedSchedule( {        //5
            table: [ 'monday', 'tuesday', 'wednesday', 'thursday', 'friday', 'saturday', 'sunday' ].map( day => ( {
              day: TextFormatUtils.format( day.slice( 0, 3 ), 'title' ),
              sched: loc[day]
            } ) ),

            template: schedTemplate || ( schedTemplate = $( '#cloners >#sched-row' ).html() ),
            tz: loc.timeZone.toUpperCase()
          } ).schedWeekly,

          locationContent.directionsHref                                            //6
        ];

        var $item = $('#cloners >.card').clone().html(function (i, was) {
          return CommonUtils.fillTemplate(was, cardContent, true);
        });

        TruistLocationsMap.createMarker(coords, String(index + 1), $item, loc.advLocAddrLine1);
        $item.find('.get-direction').data('marker-index', index);
        loc.hideHours && $item.find('.hours-content .order-1').remove();
        $item.find('.advisor-loc-phone').toggle(loc.phone ? true : false).find('>a').attr('href', "tel:".concat(loc.phone));
        $item.find('.advisor-loc-fax').toggle(loc.fax ? true : false).find('>a').attr('href', "tel:".concat(loc.fax));

        // Step 3: Return generated card to the calling method, which will add it to page DOM:
        return $item;
      }

      function prepLocationContent( loc, saddr ) {
        var cityState = "".concat(TextFormatUtils.format(loc.advLocCity, 'title'), ", ").concat(loc.advLocState.toUpperCase());
        var zip = loc.advLocZip || loc.advLocZip5;
        var addrParts = [];
        loc.adv_LOC_TITLE && addrParts.push( TextFormatUtils.format( loc.adv_LOC_TITLE, 'title' ) );
        loc.advLocAddrLine1 && addrParts.push( `${TextFormatUtils.format( loc.advLocAddrLine1, 'streetAddress' )},` );
        loc.advLocAddrLine2 && addrParts.push( `${TextFormatUtils.format( loc.advLocAddrLine2, 'streetAddress' )},` );
        ( addrParts.length < 2 ) ? addrParts.push( cityState, zip ) : addrParts.push( `${cityState}  ${zip}` );

        var miles = Number(loc.miles).toFixed(1);
        var destinationText = addrParts.slice( loc.adv_LOC_TITLE ? 1 : 0 ).join( ' ' ).trim().replace( /\s+/, ' ' );

        return {  // TODO: consider attaching this object to loc, so we can re-use the one generated for location 0
          addrParts: addrParts,
          miles: miles >= 0.1 ? miles : '',
          destinationText: destinationText,
          directionsHref: `${PROTOCOL}//maps.google.com/maps?saddr=${saddr}&daddr=${encodeURIComponent( destinationText )}`
        };
      }

      return {
        buildResultList: buildResultList
      };
    }(),

    //---------------------------------------
    handleMapViewToggle: function handleMapViewToggle(ev) {
      ev.preventDefault();
      $resultPagesWrapper.hide();
      $mapView.addClass('show');
      TruistLocationsMap.showMarkers();
      $listViewToggle.show().data('return-to', $(this)).focus();
    },

    handleListViewToggle: function handleListViewToggle(ev) {
      ev.preventDefault();
      $resultPagesWrapper.show();
      $mapView.removeClass('show');
      $listViewToggle.hide().data('return-to').focus();
    },

    noResultsModeIn: function noResultsModeIn() {
      $seeAllLinkage.add( $prefDirectionsLink ).addClass( 'hide' );
    },

    handleMoreLess: function handleMoreLess(ev) {
      ev.preventDefault();
      _private.activatePages($(this).data('delta'));
    },

    activatePages: function activatePages(hominy) {
      $resultPages.addClass('js-show-me');
      // hominy >= 0 ? $resultPages.not('.js-show-me').slice(0, hominy).addClass('js-show-me') : $resultPages.filter('.js-show-me').slice(hominy).removeClass('js-show-me');
    },

    handleMarker: function handleMarker() {
      var $me = $(this);
      $me.parent().prevAll().addBack().addClass('js-show-me');
      $me.addClass('chosen').siblings().removeClass('chosen');
      CommonUtils.rollTo($me);
    }
  };

  //---------------------------------------
  var _public = {
    init: _private.init
  };

  _private.preInit();
  return _public;
}();
