"use strict";

window.Paginator = function () {
  var options = {};
  var currentPage = 0;
  var mode, rowsPerPage;
  var lastPage;
  var $container, $rows, $pages;
  var $ui, $showMore, $showLess;
  var $paginationMode;

  var _private = {
    ENS: "Paginator",
    DEFAULT_PG_ROWS: 2,
    MODE: {
      SCROLL_MORE: "scrollmore",
      CLICK_MORE: "loadmore",
      NUMBERED_PAGES: "pagination",
    },
    init: function init(opts) {
      options = opts;
      rowsPerPage = options.pgRows || _private.DEFAULT_PG_ROWS;
      $container = $(
        options.containerSelector ? options.containerSelector : window
      );
      $rows = $(options.rowSelector);
      $ui = $(options.uiSelector);
      $paginationMode = $(options.paginationMode);

      mode =
        String(options.autoload) == "true"
          ? _private.MODE.SCROLL_MORE
          : options.pgMode;

      if (mode != _private.MODE.SCROLL_MORE) {
        for (var i = 0; i < $rows.length; i += rowsPerPage) {
          $rows
            .slice(i, i + rowsPerPage)
            .wrapAll('<div class="pagination-wrapper"></div>');
        }

        $pages = $rows.parent();
      }

      switch (mode) {
        case _private.MODE.SCROLL_MORE:
          $container.on("scroll.".concat(_private.ENS), _private.handleScroll);
          break;

        case _private.MODE.CLICK_MORE:
          if ($rows.length > rowsPerPage) {
            if (currentPage == 0) {
              $showMore = $ui
                .find(".pg-show-more")
                .off("click keypress")
                .on("click keypress", function (e) {
                  if (
                    e.type === "click" ||
                    e.keyCode === 13 ||
                    e.keyCode === 32
                  ) {
                    e.preventDefault();
                    _private.increment(e);
                  }
                });

              $showLess = $ui
                .find(".pg-show-less")
                .off("click keypress")
                .on("click keypress", function (e) {
                  if (
                    e.type === "click" ||
                    e.keyCode === 13 ||
                    e.keyCode === 32
                  ) {
                    e.preventDefault();
                    _private.decrement(e);
                  }
                });
            }
          }
          break;
        case _private.MODE.NUMBERED_PAGES:
          if ($rows.length > rowsPerPage) {
            $paginationMode.css("display", "flex");

            $paginationMode.pagination({
              items: $rows.length,
              itemsOnPage: rowsPerPage,
              edges: 0,
              cssStyle: "light-theme",
              onPageClick: _private.setPage,
              currentPage: currentPage || 1,
            });
          } else {
            $paginationMode.css("display", "none");
          }
          break;
        default:
          throw "INVALID PAGE MODE!";
      }
      _private.setPage(currentPage);
    },

    setPageFocus: function setPageFocus(currentpg) {
      var $current = $pages.eq(currentpg - 1);
      console.log($current);
      $("body, html").animate(
        {
          scrollTop: $current.offset().top,
        },
        600
      );
      $current
        .children()
        .children()
        .children()
        .closest(".item")
        .first()
        .attr("tabindex", -1)
        .focus();
    },

    setPage: function setPage(pg, ev) {
      console.log(ev);
      $paginationMode.find("li .prev, li .next").empty();
      currentPage = pg || 1;
      var end = currentPage;
      var start = mode == _private.MODE.NUMBERED_PAGES ? end - 1 : 0;
      lastPage = end >= $pages.length;

      var $showRows = $pages.slice(start, end).children().trigger("show");
      console.log($showRows);
      $rows.not($showRows).trigger("hide");

      if (lastPage) {
        $container.off("scroll.".concat(_private.ENS));
      } else {
        $container.trigger("scroll.".concat(_private.ENS));
      }

      ev && _private.setPageFocus(currentPage);

      if (mode == _private.MODE.CLICK_MORE) {
        $showMore.toggle(!lastPage);
        $showLess.toggle(currentPage > 1);
      }
    },
    increment: function increment(ev) {
      _private.setPage(++currentPage, ev);
    },
    decrement: function decrement(ev) {
      _private.setPage(--currentPage, ev);
    },
    handleScroll: function handleScroll() {
      var containerOffsetTop = 0;
      try {
        containerOffsetTop = $container.offset().top;
      } catch (e) {}
      $ui.offset().top - containerOffsetTop - $container.scrollTop() <=
        $container.height() && _private.increment();
    },
  };
  var _public = {
    init: _private.init,
    resetCurrentPage: function resetCurrentPage(x) {
      currentPage = x;
    },
  };
  return _public;
};

