    if ($('.quiz-container')[0]) {
        var myQuestions = jsonResponse.questions;
        generateQuiz(myQuestions, quizContainer);
    }

    function generateQuiz(questions, quizContainer) {

        function showQuestions(questions, quizContainer) {
            // we'll need a place to store the output and the answer choices
            var output = [];
            var answers;
            var totalQuestions = questions.length;

            // for each question...
            for (var i = 0; i < totalQuestions; i++) {

                // first reset the list of answers
                answers = [];

                // for each available answer to this question...
                for (letter in questions[i].answers) {

                    // ...add an html radio button
                    answers.push(
                        '<div class="quizOption">' +
                        '<input type="radio" class="option" tabindex="0" id="question' + i + letter + '" name="question' + i + '" value="' + letter + '">' +
                        '<label class="optionLabel" for="question' + i + letter + '">' +
                        questions[i].answers[letter] +
                        '</label>' +
                        '</div>'
                    );
                }

                // add this question and its answers to the output
                output.push(
                    '<div class="quizSlide">' +
                    '<div class="questionSec">' +
                    '<h2 class= "quiz-heading" > '+ quiz_heading + '</h2>' +
                    '<div class="question-text" role="heading" aria-level="3" id="question-' + i + '">' + questions[i].question + '</div>' +
                    '</div>' +
                    '<div class="answers" role="radiogroup" aria-labelledby="question-' + i + '" aria-describedby="PaginatorText">' + answers.join('') + '</div>' +
                    '</div>'
                );
            }

            // finally combine our output list into one string of html and put it on the page
            quizContainer.innerHTML = output.join('');

            //Question text animation
            $(".quiz-heading,.question-text").css({
                "left": "800px"
            }).animate({
                "left": "0px"
            }, 500);
        }

        // show the questions
        showQuestions(questions, quizContainer);
    }

    //Select answer function
    var selectAnswer = function () {
        $("input:radio[name=question" + currentQuestion + "]").off().change(function () {
            //If the checkbox is checked.
            if ($(this).is(':checked')) {
                                                            OnUpQuiz_SelectedAnswers[currentQuestion]= $(this).val();
                //Enable the continue or get results button(s).
                $('#continue_btn').attr("disabled", false);
                $('#getResults_btn').attr("disabled", false);
            } else {
                //If it is not checked, disable the button(s).
                $('#continue_btn').attr("disabled", true);
                $('#getResults_btn').attr("disabled", true);
            }
        });
    }

    //Store the total number of questions
    var totalQuestions = $('.quizSlide').length;

    //Set the current question to display to 1
    var currentQuestion = 0;

