window.onload = function () {
  let htmlVideos = document.querySelectorAll("video");
  let autoPlayingLottieAnimations = document.querySelectorAll(
    ".lottie-play-on-visible"
  );
  let wistiaVideos = document.querySelectorAll(".wistia_embed");
  let prefersReducedMotion = window.matchMedia(
    "(prefers-reduced-motion: reduce)"
  ).matches;

  const wistiaVideoConfig = {
    root: null,
  };

  // create the observer
  let wistiaVideoObserver = new IntersectionObserver(function (entries, self) {
    entries.forEach((entry) => {
      if (entry.isIntersecting === true) {
        // pauseWistiaVideos(entry);
      }
    });
  }, wistiaVideoConfig);

  // observe each of the wistia videos
  wistiaVideos.forEach((wistiaVideo) => {
    wistiaVideoObserver.observe(wistiaVideo);
  });

  // pauses all the wistia videos
  function pauseWistiaVideos(entry) {
    window._wq = window._wq || [];
    window._wq.push({
      id: "_all",
      onReady: function (video) {
        let videoId = video.data.media.hashedId;
        Wistia.api(videoId).pause();
      },
    });

    if (entry !== undefined) {
      wistiaVideoObserver.unobserve(entry.target);
    }
  }

  // pauses all the html videos
  function pauseHtmlVideo(videoContainer) {
    videoContainer.pause();
  }

  // removes the class that causes the lottie animations to play
  function removeLottieAutoplay(lottieContainer) {
    lottieContainer.classList.remove("lottie-play-on-visible");
  }

  // check to see if the user has set prefer-reduced-motion to reduce
  if (prefersReducedMotion === true) {
    let prefersReducedMotionBodyClass = document.querySelector("body")
    if (window.location.search.includes("unset-prefers-reduced-motion") || prefersReducedMotionBodyClass.classList.contains("unset-prefers-reduced-motion")) return;
    htmlVideos.forEach((htmlVideo) => {
      pauseHtmlVideo(htmlVideo);
    });

  }
};
