(function () {
    const HeroBanner = document.querySelectorAll('.page-hero-banner');
    if (HeroBanner.length === 0) {
        return;
    } else {
        $(document).ready(function () {
            var windowSize = window.matchMedia('(max-width: 1024px)');
            backgroundColor(windowSize);
            windowSize.addListener(backgroundColor);
        });

        $(document).on('keypress', 'a.modalWindow', function (e) {
            var $thisPopup = $($(this).data("target"));
            if (e.keyCode === 13 || e.keyCode == 32) {
                $thisPopup.modal('toggle');
            }
        });

        function backgroundColor(e) {
            var whiteBackground = document.getElementsByClassName('orion-hero-white-opacity');
            var purpleBackground = document.getElementsByClassName('orion-hero-purple-opacity');

            if (e.matches) {
                if (whiteBackground.length > 0) {
                    for (var i = 0; i < whiteBackground.length; i++) {
                        whiteBackground[i].style.backgroundColor = "";
                    }
                }
                if (purpleBackground.length > 0) {
                    for (var i = 0; i < purpleBackground.length; i++) {
                        purpleBackground[i].style.backgroundColor = "";
                    }
                }
            } else {
                if (whiteBackground.length > 0) {
                    for (var i = 0; i < whiteBackground.length; i++) {
                        var getOpacity = whiteBackground[i].getAttribute("data-opacity-level");
                        whiteBackground[i].style.backgroundColor = "rgba(255, 255, 255, " + getOpacity * 0.1 + ")";
                    }
                }
                if (purpleBackground.length > 0) {
                    for (var i = 0; i < purpleBackground.length; i++) {
                        var getOpacity = purpleBackground[i].getAttribute("data-opacity-level");
                        purpleBackground[i].style.backgroundColor = "rgba(46, 26, 71, " + getOpacity * 0.1 + ")";
                    }
                }
            }
        };
    }
})();
