$(document).ready(function () {
    const OptionsReveal = $('.options-reveal-comp');
    if(OptionsReveal.length === 0) {
        return;
    } else {
    function sectionChange(dropdownid, keepsection, s) {
        var $root = $(dropdownid).closest(".options-reveal-comp");
        if (keepsection.startsWith("/") || keepsection.startsWith("http")) {
            if ($('option[value="' + keepsection + '"]').attr("data-new-tab") == "true") {
                window.open(keepsection, "_blank");
            } else {
                window.location.href = keepsection;
            }
        } else if (keepsection != "#") {
            $root.find(".reveal-content").hide();
            $root.find(".actual-content").show();
            for (i = 0; i < dropdownid.length; i++) {
                if (document.getElementById(dropdownid[i].value)) {
                    $("#" + dropdownid[i].value).addClass("section-change-hide")
                    $("#" + dropdownid[i].value).removeClass("section-change-show")
                }
            }
            $("#" + keepsection).removeClass("section-change-hide")
            $("#" + keepsection).addClass("section-change-show")
            jump('options-unveil', s)
        } else if (keepsection == "#") {
            $root.find(".reveal-content").hide();
            $root.find(".default-content").show();
        }
    }

    function jump(h, s) {
        var top = document.getElementById(h).offsetTop,
            left = document.getElementById(h).offsetLeft;
        var doc = document.documentElement;
        var elmTop = (window.pageYOffset || doc.scrollTop) - (doc.clientTop || 0);
        var animator = createAnimator({
            start: [0, elmTop],
            end: [left, top],
            duration: 1000
        }, function (vals) {
            window.scrollTo(vals[0], vals[1]);
        });

        //run
        animator();
    }

    //Animator
    //Licensed under the MIT License
    function createAnimator(config, callback, done) {
        if (typeof config !== "object") throw new TypeError("Arguement config expect an Object");

        var start = config.start,
            mid = $.extend({}, start), //clone object
            math = $.extend({}, start), //precalculate the math
            end = config.end,
            duration = config.duration || 1000,
            startTime, endTime;

        function precalculate(a, b, c, d) {
            return [(b - d) / (a - c), (a * d - b * c) / (a - c)];
        }

        function calculate(key, t) {
            return t * math[key][0] + math[key][1];
        }

        function step() {
            var t = Date.now();
            var val = end;
            if (t < endTime) {
                val = mid;
                for (var key in mid) {
                    mid[key] = calculate(key, t);
                }
                callback(val);
                requestAnimationFrame(step);
            } else {
                callback(val);
                done && done();
            }
        }

        return function () {
            startTime = Date.now();
            endTime = startTime + duration;

            for (var key in math) {
                math[key] = precalculate(startTime, start[key], endTime, end[key]);
            }
            step();
        }
    }

    $(".options-reveal-comp").each(function (ev) {
        var $root = $(this);
        var select = $root.find(".select-content")[0];
        $(select).change(function () {
            $(this).closest(".options-reveal-comp").find(".go-button").attr("data-wa-linkname", $(this).find("option:selected").text().trim());
        });
        $root.find(".go-button").click(function () {
            sectionChange(select, select.value, this);
        });
    });

    //update arrow open select open
    $(document).mouseup(function(e) {
        //conditional check
        let select = $('.truist-drop-down-box select');
        let selectWrapper = $('.truist-select-wrapper');
    	if (!$(e.target).is(select) && selectWrapper.hasClass('truist-select-wrapper-open')) {
			$('.truist-select-wrapper').removeClass('truist-select-wrapper-open');
    	}
	});

    openOnSelect = function() {
        let select = $('.truist-drop-down-box select');
            select.click(function(){
                $('.truist-select-wrapper').toggleClass('truist-select-wrapper-open');
            });
        }

    openOnSelect();
}
});
$(document).ready(function () {
  $('.ori-tabs__tab:not(.is-active) button').attr('aria-selected', false);
  $('.ori-tabs__tab.is-active button').attr('aria-selected', true);
  $('.ori-tabs__panel').attr({
    'tabindex': '-1',
    'aria-hidden': 'true'
  });
  $('.ori-tabs__panel.is-active').attr({
    'tabindex': '0',
    'aria-hidden': 'false'
  });
  $('.ori-tabs__scrollable-button').removeAttr('aria-selected');

  $('.truist-tabs .ori-tabs__list .ori-tabs__tab').keyup(function (e) {
    let buttonSelected = $('.truist-tabs .ori-tabs__list .ori-tabs__tab button.is-active');
    let buttonSelectedNext = $(buttonSelected).closest('.ori-tabs__tab').next().find(".ori-tabs__tab__button");
    let buttonSelectedPrev = $(buttonSelected).closest('.ori-tabs__tab').prev().find(".ori-tabs__tab__button");
    let activePanelCall = $(buttonSelected).attr('data-target');
    activePanelCall = activePanelCall.substring(activePanelCall.indexOf('-') + 1);
    if (e.which === 39) {
      if (buttonSelected) {
        if (buttonSelectedNext.length > 0) {
          console.log($("#panel-" + activePanelCall).next());
          $(buttonSelectedNext).closest('.ori-tabs__tab').addClass('is-active');
          $(buttonSelectedNext).addClass('is-active').attr({
            'aria-selected': 'true',
            tabindex: '0'
          }).addClass('is-active').focus();
          $(buttonSelectedNext).closest('.ori-tabs__tab').siblings().removeClass('is-active').find('.ori-tabs__tab__button').removeClass('is-active').attr({
            'aria-selected': 'false',
            tabindex: '-1'
          }).blur();
            $('.ori-tabs__panel').removeClass('is-active').attr({
              'aria-hidden': 'true',
              tabindex: '-1'
            });
            $("#panel-" + activePanelCall).next().addClass('is-active').attr({
              'aria-hidden': 'false',
              tabindex: '0'
            });
        }
      }
    } else if (e.which === 37) {
      if (buttonSelected) {
        if (buttonSelectedPrev.length > 0) {
          $(buttonSelectedPrev).closest('.ori-tabs__tab').addClass('is-active')
          $(buttonSelectedPrev).addClass('is-active').attr({
            'aria-selected': 'true',
            tabindex: '0'
          }).addClass('is-active').focus();
          $(buttonSelectedPrev).closest('.ori-tabs__tab').siblings().removeClass('is-active').find('.ori-tabs__tab__button').removeClass('is-active').attr({
            'aria-selected': 'false',
            tabindex: '-1'
          }).blur();
          $('.ori-tabs__panel').removeClass('is-active').attr({
            'aria-hidden': 'true',
            tabindex: '-1'
          });
          $("#panel-" + activePanelCall).prev().addClass('is-active').attr({
            'aria-hidden': 'false',
            tabindex: '0'
          });
        }
      }
    }
  });
});

const OriTabs = (function (props) {
  const _private = {
    Cache: {},

    cacheDom() {
      _private.Cache.$parent = $('.js-ori-tabs');
      _private.Cache.$tab = $('.js-ori-tabs__tab');
      _private.Cache.$tabButton = $('.js-ori-tabs__tab__button')
      _private.Cache.$panel = $('.js-ori-tabs__panel');
      _private.Cache.$tabList = $('.js-ori-tabs__list');
      _private.Cache.$scrollLeft = $('.js-scrollable-left');
      _private.Cache.$scrollRight = $('.js-scrollable-right');

    },

    bindEvents() {
      _private.Cache.$tabButton.on('click', function (e) {
        _private.changePanel(_private.getPanel($(this)));
      });

      $(window).on('focusin', function (e) {
        if ($('.js-ori-tabs__tab__button').has(':focus')) {
          _private.adjustFocus(e.target);
        }
      })

      _private.Cache.$scrollRight.on('click', function () {
        _private.getNextTab($(this));
      });

      _private.Cache.$scrollLeft.on('click', function () {
        _private.getPrevTab($(this));
      });

      _private.Cache.$tabList.on('scroll', function () {
        _private.addButtons($(this));
      });

      $(window).resize(function () {
        $('.js-ori-tabs__list').each(function () {
          _private.checkWidth($(this));
        });
      });
     },

    render() {
      _private.setOrder($('.js-ori-tabs__tab'));
      _private.addButtons($('.js-scrollable-left'));
      _private.addButtons($('.js-scrollable-right'))
      _private.checkWidth($('.js-ori-tabs__list'));
    },

    getPanel(tabSelector) {
      return $(tabSelector).attr('data-target');
    },

    setOrder(elem) {
      $(elem).each(function (i) {
        $(this).attr('data-order', i);
      });
    },

    addButtons(elem) {
      let $this = $(elem);
      let elemWidth = $this.outerWidth();
      let scrollWidth = $this.get(0).scrollWidth;
      let $elemScroll = $this.scrollLeft();
      let $firstChildWidth = $this.children().first().outerWidth() / 2;
      let $leftButton = $this.siblings('.js-scrollable-left');
      let $rightButton = $this.siblings('.js-scrollable-right');

      if ($elemScroll >= $firstChildWidth) {
        $leftButton.removeClass('ori-display--none');
      } else {
        $leftButton.addClass('ori-display--none');
      }
      if (((scrollWidth - $elemScroll) >= (elemWidth - 1)) && ((scrollWidth - $elemScroll) <= (elemWidth + 1))) {
        $rightButton.addClass('ori-display--none');
      } else {
        $rightButton.removeClass('ori-display--none');
      }
    },

    getRightWidth(elem) {
      return $(elem).offset().left + $(elem).width();
    },

    checkWidth(e) {
      let $this = $(e);
      let $thisWidth = $this[0].scrollWidth;
      let $scrollRight = $this.siblings('.js-scrollable-right');
      let $scrollLeft = $this.siblings('.js-scrollable-left');
      let $parent = $this.parents('.js-ori-tabs');
      let $parentWidth = $parent.width();
      if ($thisWidth > $parentWidth) {
        $scrollRight.removeClass('ori-display--none');
      }

      if ($thisWidth <= $parentWidth) {
        $scrollRight.addClass('ori-display--none');
        $scrollLeft.addClass('ori-display--none');
      }
    },

    changePanel(target) {
      const $target = $(target);
      const $targetSiblings = $target.siblings('.js-ori-tabs__panel');
      const triggerID = $target.attr('data-trigger');
      const $tab = $(triggerID);
      const $tabParent = $tab.parent('.js-ori-tabs__tab');
      const $tabSiblings = $tabParent.siblings('.js-ori-tabs__tab');
      const $buttonSiblings = $tabSiblings.children('.js-ori-tabs__tab__button');

      $targetSiblings
        .removeClass('is-active')
        .attr('aria-hidden', true)
        .removeAttr('tabindex', '0')
        .attr('tabindex','-1');

      $target
        .addClass('is-active')
        .attr('aria-hidden', false)
        .removeAttr('tabindex', '-1')
        .attr('tabindex', '0');

      $tab
        .addClass('is-active')
        .attr('aria-pressed', true)
        .attr('aria-selected', true);

      $tabParent
        .addClass('is-active');


      $tabSiblings
        .removeClass('is-active')
        .attr('aria-selected', false);


      $buttonSiblings
        .removeClass('is-active')
        .attr('aria-pressed', false);
    },

    adjustFocus(elem) {

    },

    getPrevTab(target) {
      //alert("getPrev")
      const $target = $(target);
      const $listParent = $target.siblings('.js-ori-tabs__list');

      let newScrollLeftValue = $listParent.scrollLeft() - $listParent.width() + 50;

      if (newScrollLeftValue < 50) {
        newScrollLeftValue = 0;
      }

      $listParent.animate({
        scrollLeft: newScrollLeftValue
      });

      _private.addButtons($listParent);
    },

    getNextTab(target) {
      const $target = $(target);
      const $listParent = $target.siblings('.js-ori-tabs__list');
      const maxScrollLeftValue = $listParent.get(0).scrollWidth - $listParent.width();
      let newScrollLeftValue = $listParent.scrollLeft() + $listParent.width() - 50;

      if (newScrollLeftValue >= maxScrollLeftValue) {
        newScrollLeftValue = maxScrollLeftValue;
      }

      $listParent.animate({
        scrollLeft: newScrollLeftValue
      });

      _private.addButtons($listParent);
    },

    init() {
      _private.cacheDom();
      _private.render();
      _private.bindEvents();
    }
  }

  const _public = {
    init: _private.init,
    getPanel: _private.getPanel,
    changePanel: _private.changePanel,
    getPrevTab: _private.getPrevTab,
    getNextTab: _private.getNextTab
  }


  return Object.assign(
    _public,
    props
  );
});

