function getAndSetMortgageData(rateCardElement) {
  // locate data attributes to fetch the data and apply the correct templating
  let rateCardDataPath = rateCardElement.getAttribute("data-path");
  let rateCardTitle = rateCardElement.getAttribute("data-rate-name");
  let rateCardIcon = rateCardElement.getAttribute("data-icon-src");
  let rateCardHeader = rateCardElement.getAttribute("data-item-selection-header");
  let rateCardQuery = `${rateCardDataPath}?loanid=${rateCardHeader}`;

  // set loading animation
  fadeInMortgageRates(rateCardElement);
  loadingTable(rateCardElement);

  // fetch the data
  fetchWithTimeout(rateCardQuery, {}, 10000)
    .then((response) => response.json())
    .then((json) => {
      // set the output of the createTable function as the HTML on the page
      rateCardElement.innerHTML = createRateCard(json, rateCardTitle, rateCardIcon);
      rateCardElement.setAttribute("data-component-loaded", "true");
    })
    .catch((error) => {
      // set the output of the createTable function as the HTML on the page
      rateTableError(rateCardElement, rateCardTitle, rateCardIcon);
      rateCardElement.setAttribute("data-component-loaded", "false");
      console.log(error);
    });
}

