function setCookie() {
    let alertCookie = $('.globalalertv2 div').first().attr('id');
    document.cookie = "alert =" + alertCookie + ";";
 }

 function getCookie(alert) {
  let name = alert + "=";
  let spli = document.cookie.split(';');
  for(var j = 0; j < spli.length; j++) {
    let char = spli[j];
    while (char.charAt(0) == ' ') {
      char = char.substring(1);
    }
    if (char.indexOf(name) == 0) {
      return char.substring(name.length, char.length);
    }
  }
  return "";
}

 function readCookie() {
  let cookie = getCookie("alert");
   if (cookie == "") {
     return;
   } else {
    $('#' + cookie).css('display','none');
  }
 }

