/* On-Page Modal script */

$(document).ready(function(){
    $('.onPageModal_container .btn-primary1').click(function(){
        if($(this).parents().hasClass("modal-content")){
            $(this).closest(".modal").hide();
            $(".modal-backdrop").hide();
        }
    });
});

function speedbump_redirectURL() {
    var queryParam = speedbump_getURLParameter('url');
    if (queryParam != "") {
        var finalUrl = queryParam.split('url=');
        window.location.replace(finalUrl[1]);
    }
}

function speedbump_getURLParameter(sParam) {
    var sPageURL = window.decodeURIComponent(window.location.search.substring(1));
    var hash = window.location.hash.substring(1);
    if (hash != "")
        var pageurl = sPageURL + "#" + hash;
    else
        var pageurl = sPageURL;
    return pageurl;
}

'use strict';

// This must run AFTER component-specific libraries have loaded:
jQuery($ => {
  const QUERY_PARAMS = new URLSearchParams(window.location.search);

  $('[data-component-helper]').each((index, element) => {
    const $WRAPPER = $(element);
    const HELPER = window[$WRAPPER.data('componentHelper')];
    try {
      !HELPER.instances && (HELPER.instances = []);
    } catch(e) {}

    const OPTIONS = {
      index: index,
      wrapperData: $WRAPPER.data(),
      queryParams: QUERY_PARAMS
    };

    try {
      const HELPER_INSTANCE = HELPER();
      HELPER.instances.push(HELPER_INSTANCE);
      HELPER_INSTANCE.init($WRAPPER, OPTIONS);
    }
    catch (err) { }
  });
  /*Loan Quiz Xf component loader*/
  $('.loading-container').fadeOut(2000, function () {
    $('.loan-quiz .container-fluid').fadeIn(200);
  });
});

